    location: 'Location 2',
  },
  {
    profileImg: 'https://example.com/hotel2-profile.jpg',
    title: 'Hotel 2',
    location: 'Location 2',
  },
];

return (
    <>
      <PageTitleSelect title='Տեսարժան վայրեր' />
      <div className="monuments-page">
        {monumentsData.map((monument, index) => (
          <ProfileCard key={index} {...monument} />
        ))}
      </div>
    </>
  );
};

export default Monuments;
